INSERT INTO `dogs` (`id`, `title`, `description`, `date`, `city`, `adopted`, `users_id`, `created_at`, `updated_at`) VALUES
(1, 'Perro cachorro\r\n', 'Tengo para dar en adopción cachorro de 7 meses aproximadamente. Juguetón, cariñoso. Se lleva bien con perros gatos y niños. Tamaño mediano. Bien cuidado. ', '2018-11-01', 'Sevilla', '0', NULL, '2018-11-19 20:20:04', '2018-11-19 20:18:11'),
(2, 'Urgente!Perrita de 3 meses', 'Perrita de aproximadamente 3 meses se encuentra viviendo en la calle intentando sobrevivir a las fuertes lluvias, se busca adoptante responsable ya que es muy temerosa y vive en condiciones realmente precarias. ', '2018-11-04', 'Madrid', '0', NULL, '2018-11-17 11:47:05', '0000-00-00 00:00:00'),
(3, 'Perrita de 2 meses', 'Perrita de aproximadamente 3 meses se encuentra viviendo en la calle intentando sobrevivir a las fuertes lluvias, se busca adoptante responsable ya que es muy temerosa y vive en condiciones realmente precarias. ', '2018-11-03', 'Cáceres', '0', NULL, '2018-11-17 11:47:05', '0000-00-00 00:00:00'),
(6, 'Perritas en adopcion', 'Se da en adopción a dos perritas de 5 meses quedarán de tamaño grande\r\nPor favor adopten yo ya no las puede tener mas tiempo ', '2018-11-12', 'Calahorra', '0', NULL, '2018-11-18 14:05:30', '0000-00-00 00:00:00'),
(7, 'Ayuda Rescatemos a este Pitbull', 'Solicitamos apoyo a Estefi\r\nAyuda a un pitbull de mediana edad el perro fue rescatado de peleas clandestinas, el perro no esta en buenas condiciones esta solo en un pasillo todo el dia debido a q ataco a varios perros. Los dueños lo van a llevar a una perrera para q lo sacrifiquen. Yo no se q hacer ya tengo 4 perros rescatados tmb y no consigo quien lo adopte. Quisiera saber si me pueden ayudar, los dueños estan dispuestos a darlo .. el perro es dado yo lo acaricio y le doy comida\r\nContacto\r\n1559192002 ', '2018-11-05', 'Murcia', '0', NULL, '2018-11-19 20:20:11', '2018-11-19 20:19:50'),
(8, 'Luna', 'Luna (gitana la llamamos) es una perrita muy tranquila y juguetona de cinco años. Tiene cruce con yorkshire. Su dueña ha fallecido y la familia no puede hacerse cargo de ella.\r\nNecesita alguien que la quiera y cuide. ', '2018-11-04', 'Madrid', '0', NULL, '2018-11-19 20:20:42', '2018-11-19 20:20:20'),
(9, 'Cachorritos de 2 Meses son 4 hembras y 2 machos', 'Solicitamos apoyo para Atziri.\r\nHola... Buenas tardes!\r\nEstoy dando en adopción a 6 cachorritos\r\nSon 4 hembras y dos machos. Tienen 2 meses...\r\nLes comentaré rápido...\r\n\r\nLos rescate de mi vecina que no cuidó a la madre de estos cachorros y los abandonó en la calle.\r\n\r\nLos recogí y les di comida y agua. Por situaciones académicas y económicas no puedo tenerlos mas\r\n\r\nNecesito de su ayuda para poder darles una mejor calidad de vida, por favor ayúdenme a difundirlos y a encontrarles un hogar\r\nSoy de CDMX, y podemos llegar a un acuerdo el donante y yo para su entrega. De tal forma que sea segura para el cachorrito\r\nUbicación: delegación Tlahuac. A 5 minutos del metro Tlahuac\r\nEdad: 2 meses\r\nMi nombre es Atziri Avila Jiménez\r\nWhats 5514080696', '2018-11-11', 'Ávila', '0', NULL, '2018-11-18 14:11:42', '0000-00-00 00:00:00'),
(11, 'Cachorrín\r\n', 'Tengo para dar en adopción cachorro de 7 meses aproximadamente. Juguetón, cariñoso. Se lleva bien con perros gatos y niños. Tamaño mediano. Bien cuidado. ', '2018-11-01', 'Sevilla', '0', NULL, '2018-11-18 12:59:43', '2018-11-18 12:59:43');

